function seval2(n,u,x_spl,y_spl,b_spl,c_spl,d_spl)
{
		var j, k, dx;
		var i = 1; 
   if (i >= n) 			//then    i := 1
   { 
   i= 1;  
   };
   if (u <  x_spl[i])    //then  goto L10
		{
			i  = 1    ;
			j  = n+1  ;
	   };
   if (u <= x_spl[i+1])  //then  goto L30
   {
   dx = u - x_spl[i];
   };  
 //goto L10
		i  = 1    ;
		j  = n+1  ;
 //goto L20
	while(j >  (i+1)){
	k  = Math.round((i+j)/2);
 
  if (u <  x_spl[k])  { j = k;  };
  if(u==95){j = k;};
  if (u >= x_spl[k])     { i = k;};
  };
  dx = u - x_spl[i];
  var y=(y_spl[i] + dx * (b_spl[i]+ dx * (c_spl[i]+ dx* d_spl[i])));
  return y;
}

